Newlyweds have decided to spend the honeymoon in the middle of a forest and sheltered in a caravan. Relations between the two start to get confused, especially when she begins to obsess over a nearby house and with eyes that seem to spy on her with lust.

It's a slow burning story about honeymooning newlyweds Alicia and Diego, who've chosen to spend their break camping in an isolated woodland area. Everything starts happily enough, with the couple doing a little soul searching on why they feel the need to spend the rest of their lives together. But slowly strange things start to happen around the pair, and they seek help from a creepy old family living locally.


